(14, 'terms_condition', '<p><strong>Terms and Conditions</strong></p><p>Welcome to JustTenh. These terms and conditions outline the rules and regulations for the use of our website and services. By accessing and using our website, you agree to comply with and be bound by the following terms and conditions.</p><p><strong>1. General</strong>\r\n<br>1.1. By placing an order with JustTenh, you are offering to purchase a product on and subject to the following terms and conditions.\r\n<br>1.2. All orders are subject to availability and confirmation of the order price.\r\n<br>1.3. We reserve the right to refuse service to anyone for any reason at any time.\r\n<br>1.4. Different vendors and items may have specific terms and conditions. JustTenh is not liable for variations in terms set by different vendors.</p><p><strong>2. Pricing and Availability</strong>\r\n<br>2.1. Prices for our products are subject to change without notice.\r\n<br>2.2. We reserve the right to modify or discontinue any product at any time.\r\n<br>2.3. All descriptions of products or product pricing are subject to change at any time without notice, at our sole discretion.\r\n<br>2.4. We reserve the right to limit the quantities of any products or services that we offer.</p><p><strong>3. Orders and Payments</strong>\r\n<br>3.1. When you place an order, you will receive an acknowledgment e-mail confirming receipt of your order. This email will only be an acknowledgment and will not constitute acceptance of your order.\r\n<br>3.2. We must receive full payment for the products ordered before your order can be accepted.\r\n<br>3.3. We accept payment by Aba, Bakong, Card, and Cash.\r\n<br>3.4. Payments must be made in USD or local currency as indicated on the product page.</p><p><strong>4. Shipping and Delivery</strong>\r\n<br>4.1. Shipping costs are calculated at checkout and are based on the shipping method you select.\r\n<br>4.2. Delivery times may vary depending on your location and the shipping method chosen.\r\n<br>4.3. We are not responsible for delays caused by the shipping carrier or customs clearance.</p><p><strong>5. Returns and Refunds</strong>\r\n<br>5.1. Please refer to our [Refund Policy] for information on returns and refunds.\r\n<br>5.2. We reserve the right to refuse returns for items that do not meet our return criteria.</p><p><strong>6. Intellectual Property</strong>\r\n<br>6.1. All content included on this site, such as text, graphics, logos, images, and software, is the property of JustTenh or its content suppliers and protected by international copyright laws.\r\n<br>6.2. Unauthorized use or duplication of any materials from our website is strictly prohibited.</p><p><strong>7. Privacy Policy</strong>\r\n<br>7.1. Please refer to our [Privacy Policy] for information on how we collect, use, and protect your personal information.</p><p><strong>8. Limitation of Liability</strong>\r\n<br>8.1. JustTenh shall not be liable for any direct, indirect, incidental, special, or consequential damages that result from the use or inability to use our products or services.\r\n<br>8.2. This limitation of liability applies to all types of claims, whether based on warranty, contract, tort, or any other legal theory.\r\n<br>8.3. JustTenh is not liable for any discrepancies or issues arising from terms set by different vendors.</p><p><strong>9. Changes to Terms and Conditions</strong>\r\n<br>9.1. We reserve the right to update, change, or replace any part of these terms and conditions by posting updates and changes to our website.\r\n10.2. It is your responsibility to check our website periodically for changes. Your continued use of or access to our website following the posting of any changes constitutes acceptance of those changes.</p><p><strong>Contact Us:</strong>\r\nIf you have any questions about these terms and conditions, please contact us at:</p><ul><li>Email: <a rel=\"noreferrer\">justtenh92@gmail.com</a></li><li>Phone: 069 287 070</li></ul><p>Thank you for shopping with JustTenh. We appreciate your business and are committed to providing you with a pleasant shopping experience.</p>', NULL, '2024-07-22 10:35:37'),
(15, 'about_us', '<p><strong>About Us</strong></p><p>Welcome to JustTenh – your premier destination for fashion and style. At JustTenh, we are passionate about bringing you the latest trends, timeless classics, and unique pieces that help you express your individuality. Our e-commerce platform is designed to create a seamless and enjoyable shopping experience for both shoppers and vendors.</p><p><strong>Who We Are</strong>\r\nJustTenh is more than just a fashion store; we are a vibrant community of fashion enthusiasts, designers, and shoppers. Founded with the vision of making fashion accessible and enjoyable, JustTenh aims to connect customers with a wide array of high-quality fashion items from various vendors.</p><p><strong>Our Mission</strong>\r\nOur mission is to provide a user-friendly platform that empowers vendors to showcase their products and shoppers to discover and purchase the latest fashion trends effortlessly. We strive to make every interaction on our platform smooth, secure, and satisfying.</p><p><strong>What We Offer</strong></p><ol><li><strong>Diverse Fashion Collection:</strong> Explore a vast selection of clothing, accessories, and footwear for all occasions. Whether you\'re looking for everyday wear or something special, JustTenh has it all.</li><li><strong>Easy Vendor Collaboration:</strong> Our platform is designed to facilitate smooth collaboration between vendors and shoppers. Vendors can easily set up their stores, manage inventory, and process orders.</li><li><strong>Built-In POS Systems:</strong> JustTenh features integrated Point of Sale (POS) systems that simplify transactions and inventory management for vendors, ensuring a hassle-free experience.</li><li><strong>Secure Payment Systems:</strong> We offer various secure payment options, including Aba, Bakong, Card, and Cash, making it easy and safe for customers to complete their purchases.</li><li><strong>User-Friendly Navigation:</strong> Our website is designed with intuitive navigation, allowing users to easily browse, search, and shop for their favorite items.</li><li><strong>JustTenh App:</strong> Our mobile app makes POS system management easy for both users and vendors. Vendors can manage their stores, track sales, and handle transactions on the go, while shoppers can enjoy a seamless shopping experience.</li></ol><p><strong>Why Choose JustTenh?</strong></p><ol><li><strong>Quality and Variety:</strong> We carefully select our vendors to ensure that we offer only the best quality products. Our diverse range means there\'s something for everyone.</li><li><strong>Customer Support:</strong> We are dedicated to providing excellent customer service. Our support team is always here to help with any questions or concerns.</li><li><strong>Vendor Support:</strong> We support our vendors with tools and resources to help them succeed, from easy store setup to efficient order management.</li><li><strong>Community Focused:</strong> We believe in building a strong community of fashion lovers and entrepreneurs. JustTenh is a place where creativity and commerce thrive together.</li></ol><p>Join us at JustTenh and be part of a growing community that celebrates fashion, innovation, and collaboration. Whether you\'re a shopper looking for the perfect outfit or a vendor ready to showcase your latest collection, JustTenh is here to make your experience enjoyable and rewarding.</p><p>Thank you for choosing JustTenh – where fashion meets convenience.</p><p>For any inquiries, feel free to contact us:</p><ul><li>Email: <a rel=\"noreferrer\">justtenh92@gmail.com</a></li><li>Phone: 069 287 070</li></ul><p>Happy shopping!</p><p>The JustTenh Team</p>', NULL, '2024-07-22 10:41:46'),
