(45, 'privacy_policy', '<p><span style=\"font-weight: bolder;\">Privacy Policy</span></p><p>At JustTenh, we are committed to protecting your privacy. This Privacy Policy outlines how we collect, use, disclose, and safeguard your information when you visit our website and make purchases. By using our website, you agree to the terms of this Privacy Policy.</p><p><span style=\"font-weight: bolder;\">1. Information We Collect</span>&nbsp;1.1.&nbsp;<span style=\"font-weight: bolder;\">Personal Information:</span>&nbsp;When you place an order or register on our site, we collect personal information such as your name, email address, mailing address, phone number, and payment information. 1.2.&nbsp;<span style=\"font-weight: bolder;\">Non-Personal Information:</span>&nbsp;We may also collect non-personal information about you, such as your IP address, browser type, and operating system, to improve our website and services.</p><p><span style=\"font-weight: bolder;\">2. How We Use Your Information</span>&nbsp;2.1. To process and fulfill your orders. 2.2. To send you order confirmations, updates, and promotional materials. 2.3. To improve our website and customer service. 2.4. To prevent fraudulent transactions and monitor against theft. 2.5. To comply with legal obligations and resolve disputes.</p><p><span style=\"font-weight: bolder;\">3. Sharing Your Information</span>&nbsp;3.1.&nbsp;<span style=\"font-weight: bolder;\">Third-Party Service Providers:</span>&nbsp;We may share your information with third-party service providers that assist us with processing payments, delivering orders, and other business operations. 3.2.&nbsp;<span style=\"font-weight: bolder;\">Legal Requirements:</span>&nbsp;We may disclose your information if required to do so by law or in response to valid requests by public authorities. 3.3.&nbsp;<span style=\"font-weight: bolder;\">Business Transfers:</span>&nbsp;In the event of a merger, acquisition, or sale of all or a portion of our assets, your information may be transferred to the new owner.</p><p><span style=\"font-weight: bolder;\">4. Security of Your Information</span>&nbsp;We use a variety of security measures to maintain the safety of your personal information. All payment transactions are processed through secure third-party payment systems, and we do not store your payment information on our servers.</p><p><span style=\"font-weight: bolder;\">5. Your Rights</span>&nbsp;5.1.&nbsp;<span style=\"font-weight: bolder;\">Access:</span>&nbsp;You have the right to request a copy of the information we hold about you. 5.2.&nbsp;<span style=\"font-weight: bolder;\">Correction:</span>&nbsp;You have the right to request that we correct any inaccuracies in your information. 5.3.&nbsp;<span style=\"font-weight: bolder;\">Deletion:</span>&nbsp;You have the right to request that we delete your personal information, subject to certain exceptions. 5.4.&nbsp;<span style=\"font-weight: bolder;\">Opt-Out:</span>&nbsp;You have the right to opt-out of receiving marketing communications from us.</p><p><span style=\"font-weight: bolder;\">6. Cookies and Tracking Technologies</span>&nbsp;We use cookies and similar tracking technologies to enhance your experience on our website. You can choose to disable cookies through your browser settings, but this may affect your ability to use certain features of our website.</p><p><span style=\"font-weight: bolder;\">7. Third-Party Links</span>&nbsp;Our website may contain links to third-party websites. We are not responsible for the privacy practices or content of these websites. We encourage you to read the privacy policies of any third-party websites you visit.</p><p><span style=\"font-weight: bolder;\">8. Changes to This Privacy Policy</span>&nbsp;We may update this Privacy Policy from time to time to reflect changes in our practices or legal requirements. We will notify you of any significant changes by posting the new Privacy Policy on our website. Your continued use of our website after any changes to this Privacy Policy constitutes your acceptance of the updated terms.</p><p><span style=\"font-weight: bolder;\">9. Contact Us</span>&nbsp;If you have any questions or concerns about this Privacy Policy or our data practices, please contact us at:</p><ul><li>Email:&nbsp;<a rel=\"noreferrer\">justtenh92@gmail.com</a></li><li>Phone: 069 287 070</li></ul><p>Thank you for trusting JustTenh with your personal information. We are committed to protecting your privacy and providing you with a secure shopping experience.</p>', NULL, '2024-07-22 10:38:19'),
