(87, 'refund-policy', '{\"status\":\"1\",\"content\":\"<p><span style=\\\"font-weight: bolder;\\\">Refunds Policy<br><\\/span><br>At JustTenh, we strive to provide our customers with the highest quality products and exceptional service. However, if for any reason you are not completely satisfied with your purchase, we are here to help. Please read our updated refund policy below.<\\/p><p><strong>Eligibility for Refunds:<\\/strong><\\/p><ol><li>Items can be canceled and are eligible for a refund only before the seller accepts the order.<\\/li><li>Items that are rejected by the seller.<\\/li><li>Items that are out of stock.<\\/li><\\/ol><p><strong>Non-Refundable Items:<\\/strong><\\/p><ol><li>Gift cards<\\/li><li>Custom or personalized items<\\/li><li>Final sale items<\\/li><li>Items accepted and shipped by the seller (unless they fall under the categories above)<\\/li><\\/ol><p><strong>How to Request a Refund:<\\/strong><\\/p><ol><li>Email our customer service team with your order number and reason for the refund request.<\\/li><li>Once your request is approved, you will receive a return authorization number and further instructions if applicable.<\\/li><li>If the item has not been accepted by the seller, the refund will be processed automatically.<\\/li><li>If the item was rejected by the seller or found to be out of stock, ensure the return authorization number is included in any correspondence.<\\/li><\\/ol><p><strong>Refund Process:<\\/strong><\\/p><ol><li>Once we receive your request, we will inspect it and notify you of the approval or rejection of your refund.<\\/li><li>If approved, your refund will be processed, and a credit will automatically be applied to your original method of payment within 7-10 business days.<\\/li><li>Shipping costs are non-refundable unless the item was out of stock or rejected by the seller.<\\/li><\\/ol><p><strong>Late or Missing Refunds:<\\/strong><\\/p><ol><li>If you haven\\u2019t received a refund yet, first check your bank account again.<\\/li><li>Then contact your credit card company; it may take some time before your refund is officially posted.<\\/li><li>Next, contact your bank. There is often some processing time before a refund is posted.<\\/li><li>If you\\u2019ve done all of this and you still have not received your refund yet, please contact us at [Customer Service Email].<\\/li><\\/ol><p><strong>Exchanges:<\\/strong><\\/p><ol><li>We only replace items if they are defective or damaged.<\\/li><li>If you need to exchange an item for the same product, email us with your order number and details about the defect or damage.<\\/li><\\/ol><p><strong>Contact Us:<\\/strong>\\r\\nIf you have any questions about our refund policy, please contact us at:<\\/p><ul><li>Email: justtenh92@gmail.com<\\/li><li>Phone: 069 287 070<\\/li><\\/ul><p>Thank you for shopping with JustTenh. Your satisfaction is our priority, and we are committed to ensuring you have a positive shopping experience.<\\/p>\"}', NULL, '2024-07-22 10:38:37'),
(88, 'return-policy', '{\"status\":0,\"content\":\"<p>abc<\\/p>\"}', NULL, '2024-07-22 10:38:53'),
(89, 'cancellation-policy', '{\"status\":\"1\",\"content\":\"<p>At JustTenh, we understand that sometimes plans change, and you may need to cancel your order. Our cancellation policy is designed to be as straightforward and customer-friendly as possible. Please read our policy below for details.<\\/p><p><strong>Eligibility for Cancellation:<\\/strong><\\/p><ol><li>Orders can be canceled only before the seller accepts the order.<\\/li><li>Once the seller accepts the order, it cannot be canceled. However, if the item is out of stock or rejected by the seller, a refund will be processed automatically.<\\/li><\\/ol><p><strong>How to Cancel Your Order:<\\/strong><\\/p><ol><li>To cancel your order, please email our customer service team at <a rel=\\\"noreferrer\\\">justtenh92@gmail.com<\\/a> with your order number and request for cancellation.<\\/li><li>If your cancellation request is received before the seller accepts the order, the order will be canceled, and you will receive a confirmation email.<\\/li><li>If the seller has already accepted the order, cancellation will not be possible, and you will need to wait for the item to be delivered. You can then follow our refund policy if the item is eligible.<\\/li><\\/ol><p><strong>Refunds for Canceled Orders:<\\/strong><\\/p><ol><li>If your cancellation request is approved, your refund will be processed, and a credit will automatically be applied to your original method of payment within 7-10 business days.<\\/li><li>Shipping costs are non-refundable unless the item was out of stock or rejected by the seller.<\\/li><\\/ol><p><strong>Exceptions:<\\/strong><\\/p><ol><li>Custom or personalized items cannot be canceled once the order is placed.<\\/li><li>Final sale items are not eligible for cancellation.<\\/li><\\/ol><p><strong>Contact Us:<\\/strong>\\r\\nIf you have any questions about our cancellation policy, please contact us at:<\\/p><ul><li>Email: <a rel=\\\"noreferrer\\\">justtenh92@gmail.com<\\/a><\\/li><li>Phone: 069 287 070<\\/li><\\/ul><p>We appreciate your understanding and thank you for shopping with [Your Fashion Brand]. We are committed to providing you with the best possible service and ensuring your satisfaction with every purchase.<\\/p>\"}', NULL, '2024-07-22 10:29:33'),
